const voting = async (toHash, setter) => {
    const hasher = await import('witness');
    setter(1);
    const to_witness = hasher.genId(toHash);
    setter(2);
    console.log(JSON.parse(to_witness));
    const format_witness = JSON.parse(to_witness).map((x) =>'0x'+ x.toString(16).padStart(8,"0"))
    console.log(format_witness);
    return JSON.stringify(format_witness);
}

export default voting;
